ev Amie valgt og skulle have [[Osty]] som mentor.\\nDe tog op mod bjergene og årene gik.\\n\\nAmie fik sit første sjæle-bånd, til et flyveegern som fik navnet [[Oliver]] \\nOliver blev brugt til at holde kontakten til Amielogseq____&apos;s forældre imens hun blev allokeret.\\nDa Amie fylder 20 år er hun nu færdig med sin allokering og en del er sket på de bare 2 år.\\n\\nAmie brugte et år efterfølgende på at være spion og var dygtig til det.\\nDer var ikke nogen som endnu har opdaget eller fundet ud af at Amie er spion.\\nOliver bringer ordre tilbage til Amie og svaret bliver returneret via Oliver. Underligt nok kom Oliver altid tilbage med en eller anden form for mad/snack\\nDe er det perfekte makkerpar.\\n\\nEn dag beslutter hun sig for at blive en del af det brændende svær i håb om at finde ud af hvorfor [[Osty]] forsvandt - ingen ved hvordan dette kommer til at ende.logseq____&quot;,536870947]],[logseq____&quot;^15logseq____&quot;,[561,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^1?logseq____&quot;,536870947]],[logseq____&quot;^15logseq____&quot;,[561,logseq____&quot;^Flogseq____&quot;,562,536870947]],[logseq____&quot;^15logseq____&quot;,[561,logseq____&quot;^Xlogseq____&quot;,29,536870947]],[logseq____&quot;^15logseq____&quot;,[561,logseq____&quot;^Vlogseq____&quot;,29,536870947]],[logseq____&quot;^15logseq____&quot;,[561,logseq____&quot;^Ulogseq____&quot;,26,536870947]],[logseq____&quot;^15logseq____&quot;,[561,logseq____&quot;^Ulogseq____&quot;,29,536870947]],[logseq____&quot;^15logseq____&quot;,[561,logseq____&quot;^Ulogseq____&quot;,557,536870947]],[logseq____&quot;^15logseq____&quot;,[561,logseq____&quot;^?logseq____&quot;,[logseq____&quot;^ logseq____&quot;,logseq____&quot;^2Hlogseq____&quot;,3],536870947]],[logseq____&quot;^15logseq____&quot;,[561,logseq____&quot;^Jlogseq____&quot;,[],536870947]],[logseq____&quot;^15logseq____&quot;,[561,logseq____&quot;^Hlogseq____&quot;,26,536870947]],[logseq____&quot;^15logseq____&quot;,[561,logseq____&quot;^Hl  skjulet stadig er i live. \\nDerfor har han besluttet sig for at vende tilbage til sine evner som spion/agent og forhåbentligt gøre en forskel ved at gå efter mere strategiske mål som har indflydelse. Folk som korrupte politikere, bandit ledere og deslige\\n\\nSit kaldenavn \\logseq____&quot;[[Lark]]\\logseq____&quot; fik han som barn som kodenavn hos sin kontakt fordi han var god til at imitere fuglelyde/sang og holdt til i skovenlogseq____&quot;,536870977]],[logseq____&quot;^15logseq____&quot;,[798,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^1?logseq____&quot;,536870977]],[logseq____&quot;^15logseq____&quot;,[798,logseq____&quot;^Flogseq____&quot;,793,536870977]],[logseq____&quot;^15logseq____&quot;,[798,logseq____&quot;^Xlogseq____&quot;,28,536870977]],[logseq____&quot;^15logseq____&quot;,[798,logseq____&quot;^Vlogseq____&quot;,28,536870977]],[logseq____&quot;^15logseq____&quot;,[798,logseq____&quot;^Ulogseq____&quot;,28,536870977]],[logseq____&quot;^15logseq____&quot;,[798,logseq____&quot;^Ulogseq____&quot;,792,536870977]],[logseq____&quot;^15logseq____&quot;,[798,logseq____&quot;^?logseq____&quot;,[logseq____&quot;^ logseq____&quot;,logseq____&quot;^2Hlogseq____&quot;,3],536870977]],[logseq____&quot;^15logseq____&quot;,[798,logseq____&quot;^Jlogseq____&quot;,[],536870977]],[logseq____&quot;^15logseq____&quot;,[798,logseq____&quot;^Hlogseq____&quot;,28,536870977]],[logseq____&quot;^15logseq____&quot;,[798,logseq____&quot;^Hlogseq____&quot;,792,536870977]],[logseq____&quot;^15logseq____&quot;,[798,logseq____&quot;^1@logseq____&quot;,true,536870977]],[logseq____&quot;^15logseq____&quot;,[798,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u64fa2f5c-e444-4bc3-9b64-5869c73a167flogseq____&quot;,536870977]],[logseq____&quot;^15logseq____&quot;,[799,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;logseq____&quot;,536870977]],[logseq____&quot;^15logseq____&quot;,[799,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^1?logseq____&quot;,536870977]],[logs  <script type="text/javascript">// Single Page Apps for GitHub Pages

      // This script checks to see if a redirect is present in the query string
      // and converts it back into the correct url and adds it to the
      // browser's history using window.history.replaceState(...),
      // which won't cause the browser to attempt to load the new url.
      // When the single page app is loaded further down in this file,
      // the correct url will be waiting in the browser's history for
      // the single page app to route accordingly.
      (function(l) {
        if (l.search) {
          var q = {};
          l.search.slice(1).split('&').forEach(function(v) {
            var a = v.split('=');
            q[a[0]] = a.slice(1).join('=').replace(/~and~/g, '&');
          });
          if (q.p !== undefined) {
            window.history.replaceState(null, null,
              l.pathname.slice(0, -1) + (q.p || '') +
              (q.q ? ('?' + q.q) : '') +
              l.hash
            );
          }
        }
      }(window.location))</script>
